css:
.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 16px;
  font-size: 11px;
  border: 1px solid #2a2f38;
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 0px;
  border-top-right-radius: 0px;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid #2a2f38;
  border-bottom-left-radius: 0px;
  border-bottom-right-radius: 0px;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 10.66666667px;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #b7c5d3;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: #7c8b99;
}
.github-PrCommitView-title {
  margin: 0 0 .25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 0px;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: #41505e;
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 16px;
  padding: 0em .2em;
  color: #41505e;
  font-style: italic;
  font-size: .8em;
  border: 1px solid #2a2f38;
  border-radius: 0px;
  background-color: #333F4A;
}
.github-PrCommitView-moreButton:hover {
  background-color: #3f515f;
}
.github-PrCommitView-moreText {
  margin-top: 8px;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 16px;
  line-height: 16px;
  vertical-align: middle;
  color: #539afc;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
